function fibonacci_modus(n) {
  var result;

  if (n <= 2) {
    result = n;
  } else if (n <= 4) {
    result = fibonacci_modus(n-1) + fibonacci_modus(n-2);
  } else if (n <= 8) {
    result = fibonacci_modus(n-4) + fibonacci_modus(n-8);
  } else if (n <= 16) {
    result = fibonacci_modus(n-8) + fibonacci_modus(n-16);
  } else if (n <= 32) {
    result = fibonacci_modus(n-16) + fibonacci_modus(n-32);
  } else if (n <= 64) {
    result = fibonacci_modus(n-32) + fibonacci_modus(n-64);
  } else if (n in range(64, Math.pow(+0, Math.floor((Math.log(+0)/Math.LN2)+1))))) return n;
  return result;
}
```

Denne code vil gennemføre forskellen mellom de n'te tal med modus-tal i en dynamisk programmering.
